// src/Pages/Home.js
import React from 'react';

function Home() {
  return (
    <div className="container">
      <div className="jumbotron mt-4">
        <h1 className="display-4">Welcome to MyApp!</h1>
        <p className="lead">This is a simple home page for your React application.</p>
        <hr className="my-4" />
        <p>Use the navigation bar to explore different sections of the app.</p>
        <a className="btn btn-primary btn-lg" href="/Pages/ProductManagement" role="button">Go to Product Management</a>
      </div>
    </div>
  );
}

export default Home;
